import React from 'react'
import './search-box.scss'

export const SearchBox = ({ onSearchKeyChanged, placeholder }) => {
  const handleChange = event => {
    onSearchKeyChanged(event.target.value)
  }

  return (
    <input
      type='search'
      className='search'
      placeholder={placeholder}
      onChange={handleChange}
    />
  )
}
